import { createSlice } from "@reduxjs/toolkit";

export const permSecSlice = createSlice({
  name: "permSec",
  initialState: {
    healthAccess: null,
    buildingCulture: null,
  },
  reducers: {
    setHealthAccessData: (state, action) => {
      state.healthAccess = action.payload;
    },
    setBuildingCultureData: (state, action) => {
      state.buildingCulture = action.payload;
    },
  },
});

export const { setPermSecData, removePermSecData } = permSecSlice.actions;

export default permSecSlice.reducer;
